const App = () => {
  console.log('State is', UseAppState())
  return (
    <div className="App">
      <AppContainer>
        <Column text={"To do"}>
          <Card text = {'Initialize the app'} />
        </Column>
        <Column text={"In Progress"}>
          <Card text = {'Learning baba'} />
        </Column>
        <Column text={"Done"}>
          <Card text = {'Learning baba'} />
        </Column>
        <AddNewItem toggleButtonText={'create'} 
        onAdd = {console.log} />
      </AppContainer>
    </div>
  );
};

export default App;
